import React from 'react';
import './header.css';

const RightSidebar = () => {
  return (
    <>
      <nav className='sidebar'>
        <ul className='container'>
          <li className='current-text'>Current Lesson</li>
          <li className='inbox-text'>Inbox</li>
        </ul>
      </nav>
    </>
  );
}

export default RightSidebar;
